// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;
import AwPanel from 'viewmodel/AwPanelViewModel';
import AwPanelBody from 'viewmodel/AwPanelBodyViewModel';
import AwPanelSection from 'viewmodel/AwPanelSectionViewModel';
import AwFlexRow from 'viewmodel/AwFlexRowViewModel';
import AwFlexColumn from 'viewmodel/AwFlexColumnViewModel';
import AwColorPicker from 'viewmodel/AwColorPickerViewModel';




/*
ctx imports
*/

const ctxImportObj = {  };




/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {
        "selectedColorL": {
            "initialValues": {
                "value": "#6c5fc8"
            },
            "meta": {}
        },
        "selectedColorR": {
            "initialValues": {
                "value": "#4abf8c"
            },
            "meta": {}
        }
    },
    "_viewModelId": "AwColorPickerExample",
    "_uniqueViewModelId": "AwColorPickerExample",
    "ctx": {}
};

/*
<aw-panel>
    <aw-panel-body class="sw-row">
        <aw-panel-section class="h-12 w-6" caption="Left">
            <aw-flex-row height="50f">
                <aw-flex-column width="12">
                    <aw-color-picker class="h-1" selected-color="data.selectedColorL"></aw-color-picker>
                    <br></br>
                    <aw-flex-row class="h-11" color="{{data.selectedColorL.value}}">
                    </aw-flex-row>
                </aw-flex-column>
            </aw-flex-row>
        </aw-panel-section>
        <aw-panel-section class="h-12 w-6" caption="Right">
            <aw-flex-row height="50f">
                <aw-flex-column width="12">
                    <aw-color-picker class="h-1" selected-color="fields.selectedColorR"></aw-color-picker>
                    <br></br>
                    <aw-flex-row class="h-11" color="{{fields.selectedColorR.value}}">
                    </aw-flex-row>
                </aw-flex-column>
            </aw-flex-row>
        </aw-panel-section>
    </aw-panel-body>
</aw-panel>
*/
const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <AwPanel  revealAction={actions.reveal}>
        <AwPanelBody className="sw-row">
            <AwPanelSection className="h-12 w-6" caption="Left">
                <AwFlexRow height="50f">
                    <AwFlexColumn width="12">
                        <AwColorPicker className="h-1" selectedColor={AwParseService.instance( "fields.selectedColorL" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                        </AwColorPicker>
                        <br>
                        </br>
                        <br>
                        </br>
                        <AwFlexRow className="h-11" color={AwParseService.instance( "fields.selectedColorL.value" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                        </AwFlexRow>
                    </AwFlexColumn>
                </AwFlexRow>
            </AwPanelSection>
            <AwPanelSection className="h-12 w-6" caption="Right">
                <AwFlexRow height="50f">
                    <AwFlexColumn width="12">
                        <AwColorPicker className="h-1" selectedColor={AwParseService.instance( "fields.selectedColorR" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                        </AwColorPicker>
                        <br>
                        </br>
                        <br>
                        </br>
                        <AwFlexRow className="h-11" color={AwParseService.instance( "fields.selectedColorR.value" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                        </AwFlexRow>
                    </AwFlexColumn>
                </AwFlexRow>
            </AwPanelSection>
        </AwPanelBody>
    </AwPanel>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
